import Espenses from './components/Expenses';

function App(props) {
  const expenses = [
    {
      id: 'e1',
      title: "Toilet paper",
      amount: 300.67,
      date: new Date(2021, 5, 19)
    },
    {
      id: 'e2',
      title: "Car insurence",
      amount: 3000,
      date: new Date(2020, 5, 17)
    },
    {
      id: 'e3',
      title: "Summer engineering analyst",
      amount: 30000,
      date: new Date(2021, 6, 20)
    },
    {
      id: 'e4',
      title: "Tarinhophyta",
      amount: 20.67,
      date: new Date(2021, 10, 12)
    }
  ]

  return (
    <div>
      <h2>My Expense Tracker</h2>
      <Expenses expenses={props.expenses} />
    </div>
  );
}

export default App;
